import { Col, Container, Row, Form } from "react-bootstrap";
import { Link } from "react-router-dom";
import logo from "../img/Blue_Futuristic_Gaming_Logo-removebg-preview.png";
import { useSelector, useDispatch } from "react-redux";
import { useState, useEffect } from "react";

const LogInPage = () => {
  const [formData, updateFormData] = useState("");

  const dispatch = useDispatch();
  const [amount, setAmount] = useState(undefined);
  const [name, setName] = useState("");
  const [senderName, setSenderName] = useState("");
  const [senderSurname, setSenderSurname] = useState("");
  const [surname, setSurname] = useState("");
  const [message, setMessage] = useState("");
  const isLoading = useSelector((state) => state.giftData.isLoading);
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState(undefined);
  const handleAmount = (e) => {
    setAmount(e.target.value);
    dispatch(giftCardInf(loginFormData));
  };
  const handleName = (e) => {
    setName(e.target.value);
    dispatch(giftCardInf(loginFormData));
  };
  const handleSenderName = (e) => {
    setSenderName(e.target.value);
    dispatch(giftCardInf(loginFormData));
  };
  const handleSenderSurname = (e) => {
    setSenderSurname(e.target.value);
    dispatch(giftCardInf(loginFormData));
  };
  const handleSurname = (e) => {
    setSurname(e.target.value);
    dispatch(giftCardInf(loginFormData));
  };
  const handleMessage = (e) => {
    setMessage(e.target.value);
    dispatch(giftCardInf(loginFormData));
  };
  const handleEmail = (e) => {
    setEmail(e.target.value);
    dispatch(giftCardInf(loginFormData));
  };
  const handlePhone = (e) => {
    setPhone(e.target.value);
    dispatch(giftCardInf(loginFormData));
  };

  const loginFormData = {
    amount: amount,
    name: name,
    surname: surname,
    message: message,
    email: email,
    phone: phone,
  };
  return (
    <Container fluid className="login-page">
      <Row className="giftcard-preview-nav py-2 ">
        <Col className="d-flex flex-column ml-5">
          <Link className="mr-auto" to={"/"}>
            <img className="logo-img " src={logo} alt="" />
          </Link>
          <span className="mr-auto">LIVE EXPIRIENCE</span>
        </Col>
      </Row>
      <Row>
        <Col className="md-5 login-content">
          <h1>Sign Up</h1>
          <span>Please fill in the form to create an account</span>
          <hr />
          <Form.Group className="d-flex">
            <Form.Label column sm={2}>
              To*
            </Form.Label>

            <Row>
              <Col>
                <Form.Control
                  placeholder="First name"
                  required
                  // onChange={handleChange}
                  onChange={handleName}
                />
              </Col>
              <Col>
                <Form.Control
                  placeholder="Last name"
                  required
                  // onChange={handleChange}
                  onChange={handleSurname}
                />
              </Col>
            </Row>
          </Form.Group>
        </Col>
      </Row>
    </Container>
  );
};
export default LogInPage;
